package interview.easy.strings;

import static interview.easy.RunTimeCompute.compute;

public class firstUniqChar {
    public static int firstUniqChar(String s) throws InterruptedException {
        int ri = s.length();
        for (char ch = 'a'; ch <= 'z'; ch++) {
            int si = s.indexOf(ch);
            if (si != -1 && si == s.lastIndexOf(ch) && si < ri)  ri = si;
        }
        return ri == s.length() ? -1 : ri;
    }

    public static int firstUniqCharWArr(String s) {
        int ri = s.length();
        for (char ch = 'a'; ch <= 'z'; ch++) {
            int si = s.indexOf(ch);
            if (si != -1 && si == s.lastIndexOf(ch) && si < ri)  ri = si;
        }
        return ri == s.length() ? -1 : ri;
    }

    public static void main(String[] args) {
        System.out.println(compute(() -> {
            try {
                return firstUniqChar("");
            } catch (InterruptedException e) {
                e.printStackTrace();
            }
            return -1;
        }));
        System.out.println((compute(() -> firstUniqCharWArr(""))));
    }
}
